# https://leetcode.com/problems/palindrome-pairs/
class Solution:
    def palindromePairs(self, words: List[str]) -> List[List[int]]:
        start = timer()
        words_len = len(words)
        if words_len == 1:
            return []
        if words_len == 2 and "" in words:
            return [[0, 1], [1, 0]]
        ans = []

        loop_cnt = 0
        for i, prefix in enumerate(words):
            for j, suffix in enumerate(words):
                loop_cnt += 1
                if i != j and self.is_palindrome(prefix + suffix):
                    ans.append([i, j])
        end = timer()
        print('palindromePairs loop_cnt:', loop_cnt, ", {} sec".format(end - start))

        return ans

    def second(self, words: List[str]) -> List[List[int]]:
        start = timer()
        words_len = len(words)
        if words_len == 1:
            return []
        if words_len == 2 and "" in words:
            return [[0, 1], [1, 0]]
        ans = []
        # https://stackoverflow.com/a/30357006
        # defaultdict는 없는 key로 접근할 경우 KeyError를 발생 시키는 대신, 키를 생성
        # checked = collections.defaultdict(False)
        checked = collections.defaultdict(lambda: False)
        # words가 일반 list인 경우: Runtime: 732 ms
        # words가 deque인 경우: Runtime: 516 ms
        words = collections.deque(words)
        
        loop_cnt = 0
        i = 0
        while words:
            word = words.popleft()
            j = i + 1
            for word2 in words:
                loop_cnt += 1
                if self.is_palindrome2(word + word2):
                    ans.append([i, j])
                if self.is_palindrome2(word2 + word):
                    ans.append([j, i])
                j += 1
            i += 1
        end = timer()
        print('second loop_cnt:', loop_cnt, ", {} sec".format(end - start))

        return ans

    # 문자열 붙이기만 테스트
    def second2(self, words: List[str]) -> List[List[int]]:
        start = timer()
        words_len = len(words)
        if words_len == 1:
            return []
        if words_len == 2 and "" in words:
            return [[0, 1], [1, 0]]
        ans = []
        checked = collections.defaultdict(lambda: False)
        words = collections.deque(words)
        
        loop_cnt = 0
        i = 0
        while words:
            word = words.popleft()
            j = i + 1
            for word2 in words:
                loop_cnt += 1
                word_check1 = word + word2
                ans.append([i, j])
                word_check2 = word2 + word
                ans.append([j, i])
                j += 1
            i += 1
        end = timer()
        print('second2 loop_cnt:', loop_cnt, ", {} sec".format(end - start))

        return ans


    def is_palindrome2(self, word: str) -> bool:
        mid = len(word) // 2

        return word[:mid] == word[:-mid - 1:-1] # 역순일 경우 -1부터 시작하므로, -mid에 1을 더 빼준다

    def is_palindrome(self, word: str) -> bool:
        right = len(word) - 1
        left = 0
        while left < right:
            if word[left] != word[right]:
                return False
            left += 1
            right -= 1

        return True
    
