    def third(self, words: List[str]) -> List[List[int]]:
        start = timer()
        trie = Trie()
        loop_cnt = 0
        ans = []
        
        # third loop_cnt: 4000 , 0.010268800000000008 sec
        for idx, word in enumerate(words):
            trie.insert(idx, word[::-1])
